window.bookSummaryJSON = "<p>Sara Grey's world shattered 10 years ago when her father was brutally murdered. Now, at 17, she is still haunted by memories of that day and driven by the need to understand why it happened. She lives a life full of secrets, and her family and friends have no idea of the supernatural world she is immersed in or of Sara's own very powerful gift. </p> <p>In her quest for answers about her father's death, Sara takes risks that expose her and her friends to danger and puts herself into the sights of a sadistic vampire. On the same fateful night she meets Nikolas, a warrior who turns Sara's world upside down and is determined to protect her even if it's the last thing she wants. </p> <p>Sara's life starts to spin out of control as she is hunted by an obsessed vampire, learns that her friends have secrets of their own, and reels from the truth about her own ancestry. Sara has always been fiercely independent, but in order to survive now she must open herself to others, to reveal her deepest secrets. And she must learn to trust the one person capable of breaking down the walls around her. </p>"; 
